style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix(http://www.google.) {
  img[url="http://www.google.com/logos/2005/winter_holiday05_5.gif"] {
    width: 0 !important;
    height: 501px !important;
    padding-left: 500px !important;
    background-image: url(http://www.google.com/logos/2005/winter_holiday05_5.gif) !important;
    background-position: middle left !important;
    background-repeat: no-repeat !important;
  }

  div[title="Google"] {
    background-image: url(http://www.google.com/logos/2005/winter_holiday05_5.gif) !important;
    background-position: top-center
    left !important;
    background-repeat: no-repeat !important;
    width: 500px !important;
    height: 501px !important;
  }

  div[title="Google"] > div {
    left: 500px !important;
    top: 502px !important;
  }
}
